// Import necessary dependencies
import React from "react";
import { Navbar, Nav, Container, Row, Col, Dropdown } from "react-bootstrap";
import "./App.css"; // Import custom CSS

// Create React component for the homepage
const HomePage = () => {
  return (
    <div>
      {/* Header */}
      <Navbar expand="lg">
        <Container>
          <Navbar.Brand href="/">
            <img
              src="https://s3.amazonaws.com/shecodesio-production/uploads/files/000/126/912/original/mirabeau-logo.png?1716116679"
              className="logo"
            ></img>
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="navbar-nav" />
          <Navbar.Collapse id="navbar-nav">
            <Nav className="ml-auto align-items-center">
              <Nav.Link href="/">Home</Nav.Link>

              {/* Dropdown for About */}
              <Dropdown>
                <Dropdown.Toggle as={Nav.Link} id="about-dropdown">
                  About
                </Dropdown.Toggle>
                <Dropdown.Menu className="dropdown-menu">
                  <Dropdown.Item href="/about/company">Company</Dropdown.Item>
                  <Dropdown.Item href="/about/team">Team</Dropdown.Item>
                  <Dropdown.Item href="/about/history">History</Dropdown.Item>
                  <Dropdown.Item href="/about/mission">Mission</Dropdown.Item>
                </Dropdown.Menu>
              </Dropdown>

              <Nav.Link href="/contact">Contact</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <div className="top-video">{/* Your top video component */}</div>

      {/* Main section */}
      <Container className="main-section">
        <Row>
          <Col md={8}>
            {/* Subsection 1 */}
            <div className="subsection">
              {/* Your content for subsection 1 */}
            </div>
          </Col>
          <Col md={4}>
            {/* Subsection 2 */}
            <div className="subsection">
              {/* Your content for subsection 2 */}
            </div>
          </Col>
        </Row>
        <Row>
          <Col md={4}>
            {/* Subsection 3 */}
            <div className="subsection">
              {/* Your content for subsection 3 */}
            </div>
          </Col>
          <Col md={4}>
            {/* Subsection 4 */}
            <div className="subsection">
              {/* Your content for subsection 4 */}
            </div>
          </Col>
          <Col md={4}>
            {/* Subsection 5 */}
            <div className="subsection">
              {/* Your content for subsection 5 */}
            </div>
          </Col>
        </Row>
      </Container>

      {/* Footer */}
      <footer className="footer">{/* Your footer content */}</footer>
    </div>
  );
};

export default HomePage;
